import React from 'react';

import { ClimbingBoxLoader } from 'react-spinners';

const Spinners = () => {
  return (
    <div className='spinners'>
      <ClimbingBoxLoader color='hsla(330, 75%, 40%, 0.84)' size={100} />
    </div>
  );
};

export default Spinners;
